        `,description:"Microsoft's AI companion integrated into its ecosystem, boosting productivity in coding and office tasks.",rating:4,detailedDescription:"GitHub Copilot, powered by OpenAI's Codex, is an AI pair programmer that provides autocompletions, suggestions, and entire code blocks directly within your editor. It's trained on a massive dataset of public code and is designed to significantly speed up the development process by reducing boilerplate and helping solve coding challenges.",documentationUrl:"https://github.com/features/copilot",isAgentic:!0,trainingDataSize:"Trained on billions of lines of public code",strengths:["Deep integration into IDEs (like VS Code)","Context-aware code suggestions","Speeds up development significantly"],weaknesses:["Suggestions can sometimes be non-optimal or contain subtle bugs","Relies on the context of existing code"],useCases:[{title:"Code Autocompletion",description:"Get entire functions or blocks of code suggested as you type."},{title:"Learning New Languages",description:"See idiomatic ways to write code in an unfamiliar programming language."}]},{name:"Grok",icon:`
